import {Context} from '../Context'
import {db} from "../firebase";
function Cheecker() {
    const {checkMatches} = useContext(Context)
    const {result} = useContext(Context)
    const {obj} = useContext(Context)
    const [data, setData] = useState({})
    useEffect(()=>{
        db.collection("User").onSnapshot(snapshot=>{
            let changes = snapshot.docChanges()
            changes.forEach(item=>{
                if(item.doc.id==9){
                    setData(item.doc.data())
                }
            })
        })
    },[])
    useEffect(()=>{
        let bunch = []
        for(const name in data){
            bunch.push(data[name])
            //console.log(data[name])
        }
        let ondDBunch = [].concat(...bunch)
        var duplicateArray = ondDBunch.filter(function(item, i, orig) {
            return orig.indexOf(item, i+1) === -1;
        });

        console.log(duplicateArray);
        //console.log(ondDBunch)
    },[data])

    let i = result.map(r=><h9>{r}</h9>)
    return (
        <div className="App">
        <header className="App-header">
            <h1>Cheecker page</h1>
        </header>
        </div>
    );
}

export default Cheecker;
